#! /usr/bin/env python

class Solution(object):
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        ans = 0
        for letter in s + t:
            ans ^= ord(letter)
        return chr(ans)

    def o_n_space_n_findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        h = {}
        for letter in s:
            h[letter] = h.get(letter, 0) + 1
        for letter in t:
            if letter not in h:
                return letter
            elif h[letter] == 0:
                return letter
            else:
                h[letter] = h[letter] - 1
        return None

    def n_log_n_findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        s = sorted(s)
        t = sorted(t)
        for (index, value) in enumerate(t):
            if index >= len(s):
                return value
            if s[index] != value:
                return value
        return None


if __name__ == '__main__':
    s = Solution()
    print(s.findTheDifference('abcd', 'abcde'))
    a = ""
    b = ""
    print(s.findTheDifference(a, b))
